import React, { Component } from 'react';

class Home extends Component {

  render() {
    return(

  <div className="container jumbotron my-5">
    <h1 className="display-3">Plan to travel the world!</h1>
      <p className="lead">Take the steps towards making your dream destinations a reality.</p>
      <p>Write out your dream bucket list , organize, and map your itineraries in a free travel app designed for vacations & road trips.</p>
      <p className="lead">
        <a className="btn btn-primary btn-lg" href="/trips" role="button">start planning your next trip</a>
      </p>
  </div>

    )
  }
}
export default Home;
